import Navbar from "components/Navbar";

const Index = (props) => {
  const { textColor } = "#f2e88e";
  return (
    <>
      <style jsx global>{`
        body {
          background-image: url("/indexmatty.jpg");
          background-position: center -200px;
          background-attachment: fixed;
        }
        .navbar {
          color: #f2e88e;
        }
      `}</style>
    </>
  );
};

export default Index;
